import '../App.scss';
import Title from '../components/title'

function Home() {
  return (
    <div className="home-container">

     <section className="top-section-homepage">
         <div className="covid-info dark"> <Title title="Covid-19 Updates" underline="lightblue" text="white" /></div>
     </section>
    </div>
  );
}

export default Home;
